import React, { Component } from 'react';
import ListBlogs from './ListBlogs';
import ScrollArea from 'react-scrollbar';

class Blogs extends Component {
  render() {
    return (
      <ScrollArea>
        <ListBlogs/>
      </ScrollArea>
    );
  }
}

export default Blogs;
